name": "schedule_meeting",
    "description": "Books a meeting time on the user's calendar with a list of attendees.",
    "parameters": {
      "type": "object",
      "properties": {
        "time": {"type": "string", "description": "Start time in HH:MM format."},
        "attendees": {"type": "array", "items": {"type": "string"}, "description": "List of required attendees' emails."},
        "duration_minutes": {"type": "integer", "description": "Duration of the meeting in minutes."}
      },
      "required": ["time", "attendees"]
    }
  },
  {
    "name": "get_stock_price",
    "description": "Retrieves the current market price for a given stock ticker.",
    "parameters": {
      "type": "object",
      "properties": {
        "ticker": {"type": "string", "description": "The stock symbol, e.g., 'GOOG', 'TSLA'."}
      },
      "required": ["ticker"]
    }
  }
]

